import React, {
  Component
} from 'react';
import './TutorServices.css';
import '../TutorSchedule/TutorSchedule.css';

export default class TutorServices extends Component {

  render() {
    const tutorServiceDetails = this.props.location.state.tutorServiceDetails;
    return (
      <div>
      <h4 id ="title">Tutor Dashboard</h4>
      <table className="table table-striped table-borderless table-hover table-card" id ="schedule">
        <thead>
          <tr className="header">
            <th>Subject Name</th>
            <th>Topic Name</th>
            <th>Category</th>
            <th>Service Type</th>
            <th>From Time</th>
            <th>To Time</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
        {tutorServiceDetails.map((value,index) => {
          return (<tr key = {index}>
            <td>{value.subjectName}</td>
            <td>{value.topicName}</td>
            <td>{value.category}</td>
            <td>{value.serviceType}</td>
            <td>{value.fromTime}</td>
            <td>{value.toTime}</td>
            <td><span><button className="btn btn-info">Confirm</button>
            <button className="btn btn-info" >Undo</button></span></td>
          </tr>
        )})}
        </tbody>
        </table>
      </div>

    )
  }

}
